import React from 'react';
import './App.css';
import AnimationSection from './components/AnimationSection';
import WhyDrop2Fill from './components/WhyDrop2Fill';
import './index.css';
import './tailwind.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Streamline Your Job Application Process with Drop2Fill Extension</h1>
        <p>Simplify and Accelerate Your Job Applications</p>
        <div className="flex justify-center space-x-4 mt-4">
          <button className="bg-blue-500 text-white py-2 px-4 rounded">Download Now</button>
          <button className="bg-gray-500 text-white py-2 px-4 rounded">Learn More</button>
        </div>
      </header>
      <WhyDrop2Fill />
      <AnimationSection />
    </div>
  );
}

export default App;
